import md5 from 'md5';
import axios from 'axios'

export const public_key= "18f003eca8be7342a9b8d88e5a8b0b22";
export const private_key= "981436151b01934bfb52fe074110ffac43b387e0";

export const ts = Date.now();
export const hash = md5(ts + private_key + public_key);

export var characters = []

this.characters = getCharacters();

function getCharacters(){
    axios.get(`https://gateway.marvel.com/v1/public/characters?ts=${ts}&apikey=${public_key}&hash=${hash}`)
.then((result) => {
console.log("listCharacters");
console.log(result);
result.data.data.results.forEach(element => {
    if (!element.description) {
        element.description = "No description available.";
    }
    
    this.characters.push(element);
});
})
.catch((error) => {
console.log(error);
});
}
